import React from "react";
import "./CreateAd.css";

function CreateAd(props) {
  return (
    <>
      <h1>Create Ad</h1>
      <form>
        <label>Title</label>
        <input name="address" />

        <label>Description</label>
        <input name="address" />
        <label>Date</label>
        <input name="date" />
        <label>Order Number</label>
        <input name="order" />
        <button>SEND</button>
      </form>
    </>
  );
}

export default CreateAd;
